import { FC } from "react";
import styles from "./Text.module.scss";

interface TextProps {
  /**
   * What is the type?
   */
  type: "h1" | "h2" | "p";
  /**
   * What is the font?
   */
  font: "primary" | "secondary";
}

const Heading: FC<TextProps> = (props: any) => {

  switch (props.type) {
    case "h1":
      return (
        <h1 className={`${styles[props.type]} ${styles[props.font]}}`}>
          {props.children}
        </h1>
      );
    case "h2":
      return (
        <h2 className={selection} {...props}>
          {props.children}
        </h2>
      );
  }
};

export default Heading;
